import Footer from "./Footer"

class HomePage extends Component {


  render() {
    return (
      <div>
        <div className={"show-room"}>
          <div className={"card"}>
            <img src={"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse2.mm.bing.net%2Fth%3Fid%3DOIP.8BYxgdEetQgAVaEU1QFi6gHaKG%26pid%3DApi&f=1"} alt="this is car image" />
          </div>
        </div>
        <Footer/>
      </div>
    );
  }
}

export default HomePage;
